uniform sampler2D im;

uniform vec2 s_col;
uniform vec4 d_Col;
uniform vec4 s_Col;

uniform vec2 d_im;
uniform vec2 s_im;
uniform vec4 d_Im;
uniform vec4 s_Im;

uniform float C1;
uniform float H1;
uniform float W1;
uniform float KH;
uniform float KW;
uniform float DH;
uniform float DW;
uniform float SH;
uniform float SW;
uniform float PH;
uniform float PW;

void main() {
    vec4 p_Col = convert_position(gl_FragCoord.xy, s_col, s_Col, d_Col) - 0.5;

    float n  = p_Col.x;
    float h2 = p_Col.y;
    float w2 = p_Col.z;
    float kh = mod(floor(floor(p_Col.w/ C1)/ KW) + 0.5, KH) - 0.5;
    float kw = mod(floor(p_Col.w/ C1) + 0.5, KW) - 0.5;
    float c1 = mod(p_Col.w + 0.5, C1) - 0.5;

    float h1 = h2 * SH - PH + kh * DH;
    float w1 = w2 * SW - PW + kw * DW;

    float v0 = (h1 < 0.0 || h1 >= H1 || w1 < 0.0 || w1 >= W1 || p_Col.w >= C1 * KH * KW) ? 0.0 : texture2D(im, convert_position(vec4(n, h1, w1, c1 + 0.0) + 0.5, s_Im, s_im, d_im) / d_im).r;
    float v1 = (h1 < 0.0 || h1 >= H1 || w1 < 0.0 || w1 >= W1 || p_Col.w >= C1 * KH * KW) ? 0.0 : texture2D(im, convert_position(vec4(n, h1, w1, c1 + 1.0) + 0.5, s_Im, s_im, d_im) / d_im).r;
    float v2 = (h1 < 0.0 || h1 >= H1 || w1 < 0.0 || w1 >= W1 || p_Col.w >= C1 * KH * KW) ? 0.0 : texture2D(im, convert_position(vec4(n, h1, w1, c1 + 2.0) + 0.5, s_Im, s_im, d_im) / d_im).r;
