uniform vec2 s_y;
uniform vec4 d_Y;
uniform vec4 s_Y;

uniform vec2 d_x;
uniform vec2 s_x;
uniform vec4 d_X;
uniform vec4 s_X;

uniform float r;
uniform float C2;

void main() {
    vec4 p_Y = convert_position(gl_FragCoord.xy, s_y, s_Y, d_Y) - 0.5;    

    float n = p_Y.x;
    float h2 = p_Y.y;
    float w2 = p_Y.z;
    float c2 = p_Y.w;

    float c1 = c2 + mod(w2, r) * C2 + mod(h2, r) * C2 * r;
    float h1 = floor(h2 / r);
    float w1 = floor(w2 / r);

    vec4 p_X = vec4(n, h1, w1, c1) + 0.5;
    vec2 p_x = convert_position(p_X, s_X, s_x, d_x);

    float v = texture2D(X, p_x / d_x).r;

    gl_FragColor = vec4(v, 0, 0, 0);
